  return (
    <>
    
    <table>
      <thead>
        <tr>
          <th>S.no</th>
          <th>Name</th>
          <th>Email</th>
          <th>Role</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        {props.userArr.map((user, index) => (
          <tr key={user.name}>
            <td>{index + 1}</td>
            <td>{user.name}</td>
            <td>{user.email}</td>
            <td>{user.role}</td>
            <td>
              {logedinUser.role === "Admin" ||
              logedinUser.role === "Manager" ? (
                <Button label="Edit" onClick={addUser}/>
              ) : (
                ""
              )}
              {logedinUser.role === "Admin" ? <Button label="Delete" /> : ""}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
    </>
  );
}

export default TableComp;
